import React from "react";
import Header from "../components/header";
import Footer from "../components/footer";
import "../css/terms.css";

function TermsOfUse() {
  return (
    <div>
      <Header />
      <div className="termsWrapper">
        <h1></h1>Terms of Use
      </div>
      <Footer />
    </div>
  );
}

export default TermsOfUse;
